    % Kein Bedarf einer korrigierten Version für MPV aus drcsim-Daten
    continue
  end
  nl = length(MPV_Liste);
  MPV_Liste(nl+1).Name = [MPV_Liste(il).Name, '_korr'];
  MPV_Liste(nl+1).MPV = MPV_Liste(il).MPV;
  % TODO: Anpassung an links/rechts
  MPV_Liste(nl+1).MPV(2:3) = MPV_Liste(1).MPV(2:3);
  MPV_Liste(nl+1).lr = MPV_Liste(il).lr;
end
